import React from 'react'

const Home = () => {
  const HandleClick = () =>{
    console.log('Hello')
  }
  const HandleClickAgain = (name) =>{
    console.log('Hello' + name)
  }

  return (
    <div className='home'>
      <h2>HomePage</h2>
      <button onClick={HandleClick}>Click Me</button>
      <button onClick={HandleClick ()}>Click Me Again</button>
    </div>
  )
}

export default Home
